function find(){let e=document.getElementById("current_value").value,t=document.getElementById("temp_rise").value,n=document.getElementById("temp_amb").value,l=document.getElementById("thickness").value,o=document.getElementById("trace_length").value;let u=Math.pow(e/(.024*Math.pow(t,.44)),1/.725),a=u/(1.378*l);document.getElementById("width_inn").value=a;let d=1*n+1*t,m=172e-8*(o*=2.54)/(u=2.54*u*2.54/1e6)*(1+.0039*(d-25)),c=m*e,g=e*e*m;console.log("The Resistance is "+m+" and Voltage "+c+" and power loss "+g+" all are for inner layers"),document.getElementById("resistance_inn").value=m,document.getElementById("voltage_inn").value=c,document.getElementById("power_inn").value=g;let v=Math.pow(e/(.048*Math.pow(t,.44)),1/.725),i=v/(1.378*l);document.getElementById("width_out").value=i;let s=172e-8*o/(v=2.54*v*2.54/1e6)*(1+.0039*(d-25)),y=s*e,r=e*e*s;document.getElementById("resistance_out").value=s,document.getElementById("voltage_out").value=y,document.getElementById("power_out").value=r}